import React from "react";
import { useLocation } from "react-router-dom";

const DatosEnvio = () => {
  const location = useLocation();
  const { datos } = location.state;

  // Acceder a los datos
  console.log(datos.userId);
  console.log(datos.producto);
  console.log(datos.cantidad);
  console.log(datos.total);
  console.log(datos.newStock);

  return (
    <div>
      <span>idUsuario: {datos.userId}</span>
      <br/>
      <span>idProducto: {datos.producto}</span>
      <br/>
      <span>cantidad: {datos.cantidad}</span>
      <br/>
      <span>totalPagar: {datos.total}</span>
      <br/>
      <span>NewStock: {datos.newStock}</span>
    </div>
  );
};

export default DatosEnvio;
